n phẩm giúp ngăn chặn sự hình thành sắc tố melanin gây thâm nám đồng thời đánh bay những vết nám trên da cực hiệu quả. Bên cạnh đó, sản phẩm ngừa mụn rất tốt. Đặc biệt là dưỡng ẩm cho da và giúp da khỏe mạnh từ sâu bên trong, những tinh chất có trong sản phẩm sẽ giúp ngăn ngừa lão hóa da. Từ đó nuôi dưỡng cho làn da thêm trẻ trung, căng mịn và đều màu cuốn hút.\r\n\r\n<img class=\"loaded\" src=\"https://media.hasaki.vn/wysiwyg/tho/57-34.jpg\" alt=\"Tinh Chất Đặc Trị Thâm Nám, Tàn Nhang Serum Vitamin C Melano CC\" width=\"500\" height=\"500\" data-was-processed=\"true\" />\r\n\r\nCùng với khả năng đánh bay nám, tàn nhang, dưỡng sáng da thì sản phẩm còn có khả năng đẩy lùi mụn hiệu quả và chống lại các nếp nhăn khá tốt.\r\n\r\n<strong>Công ty Rohto Pharmaceutical Japan</strong> có nguồn gốc lâu đời từ năm 1899 với hơn 115 năm thành lập và hiện nay đã phát triển khắp toàn cầu. Vào năm 1996 Công ty <strong>Rohto Pharmaceutical Nhật Bản</strong> đặt văn phòng đại diện tại Việt Nam và giới thiệu sản phẩm thuốc nhỏ mắt V. Rohto cùng son dưỡng môi LipIce đến người tiêu dùng Việt Nam. <strong>Rohto</strong> tung ra rất nhiều những dòng sản phẩm phù hợp với nhu cầu và thể trạng người Việt như là: Acnes hiểu rõ và chăm sóc các vấn đề về da, Lipice đa dạng chủng loại son, OXY dành riêng cho phái mạnh, Hada Labo dưỡng da...\r\n\r\n<img class=\"loaded\" src=\"https://media.hasaki.vn/wysiwyg/tho/tinh-chat-tri-tham-vitamin-c-melano-cc-rohto-nhat-ban.jpg\" alt=\"Tinh Chất Đặc Trị Thâm Nám, Tàn Nhang Serum Vitamin C Melano CC\" width=\"400\" height=\"204\" data-was-processed=\"true\" />\r\n\r\n<strong>Công dụng:</strong>\r\n\r\n- Kết hợp giữa vitamin C và E giúp ngăn chặn sự sản xuất melanin (tác nhân gây ra vết thâm nám, tàn nhang).\r\n\r\n- Ngăn ngừa mụn, rôm sảy.\r\n\r\n- Giữ cho làn da sạch, giàu ẩm, khỏe mạnh.\r\n\r\n- Nghiên cứu cho thấy CC Melano tốt hơn 10% so với sản phẩm cùng loại thông thường khác.\r\n\r\n&nbsp;\r\n\r\n<img class=\"loaded\" src=\"https://media.hasaki.vn/wysiwyg/tho/s5.jpg\" alt=\"Tinh Chất Đặc Trị Thâm Nám, Tàn Nhang Serum Vitamin C Melano CC\" width=\"605\" height=\"284\" data-was-processed=\"true\" />\r\n\r\n<strong>Bảo quản:</strong>\r\n\r\nNơi khô ráo, thoáng mát.\r\n\r\nTránh ánh nắng trực tiếp.\r\n\r\nĐể xa tầm tay trẻ em\r\n\r\n<strong>Quy cách:</strong> 20ml\r\n\r\n<strong>Thương hiệu:</strong> ROHTO\r\n\r\n<strong>Xuất Xứ:</strong> Nhật Bản','Tinh Chất Melano CC Mờ Thâm, Nám Tàn Nhang 20ml Serum Vitamin C','','publish','open','closed','','tinh-chat-melano-cc-mo-tham-nam-tan-nhang-20ml-serum-vitamin-c','','','2019-02-27 13:22:24','2019-02-27 13:22:24','',0,'http://mypham01.muathemewordpress.net/?post_type=product&#038;p=269',0,'product','',0),(270,2,'2019-02-27 08:07:45','2019-02-27 08:07:45','','57-34','','inherit','open','closed','','57-34','','','2019-02-27 08:07:45','2019-02-27 08:07:45','',269,'http://mypham01.muathemewordpress.net/wp-content/uploads/2019/02/57-34.jpg',0,'attachment','image/jpeg',0),(271,2,'2019-02-27 08:09:25','2019-02-27 08:09:25','<strong>Nước Tẩy Trang L\'Oreal Micellar Water Refreshing Even For Sensitive Skin</strong>\r\n\r\nNước tẩy trang Miccelar Water, một khái niệm không mới nhưng chưa cũ, các người mẫu và các chuyên gia trang điểm hàng đầu trên thế giới luôn sử dụng chúng. Với tính năng không cần rửa lại dịu nhẹ. Miccelar Water cho việc mang theo du lịch bất cứ nơi đâu. <strong>Nước Tẩy Trang L\'oreal 3 Trong 1 L\'oreal Moisturizing Micellar Water Cleanser</strong> có tác dụng làm sạch, giữ ẩm và dưỡng mềm da đồng thời chỉ trong một sản phẩm. Sản phẩm giúp lấy đi sạch cặn trang điểm nhưng không làm khô da. Hơn thế, thành phần an toàn, không chứa cồn và công nghệ tiên tiến giúp da giữ nước, thông thoáng, mềm mượt chỉ trong một bước.','Nước Tẩy Trang Tươi Mát L\'Oreal 3-in-1 Dành Cho Da Dầu & Da Hỗn Hợp 400ml','','publish','open','closed','','nuoc-tay-trang-tuoi-mat-loreal-3-in-1-danh-cho-da-dau-da-hon-hop-400ml','','','2019-02-27 13:52:44','2019-02-27 13:52:44','',0,'http://mypham01.muathemewordpress.net/?post_type=product&#038;p=271',0,'product','',0),(272,2,'2019-02-27 08:09:03','2019-02-27 08:09:03','','Hinh-5-nuoc-tay-trang-LOreal-Paris-3-in-1-Micellar-Water','','inherit','open','closed','','hinh-5-nuoc-tay-trang-loreal-paris-3-in-1-micellar-water','','','2019-02-27 08:09:03','2019-02-27 08:09:03','',271,'http://mypham01.muathemewordpress.net/wp-content/uploads/2019/02/Hinh-5-nuoc-tay-trang-LOreal-Paris-3-in-1-Micellar-Water.jpg',0,'attachment','image/jpeg',0),(273,2,'2019-02-27 08:10:10','2019-02-27 08:10:10','<strong>Gel Sữa Chống Nắng SENKA Perfect UV Gel SPF50/PA++++ </strong><strong>80g</strong>\r\n\r\nKem chống nắng như một lá chắn cho làn da, giúp bảo vệ da tránh khỏi những tác hại từ ánh nắng mặt trời – nguyên nhân gây nên tình trạng nám, sạm da và đặc biệt nguy hiểm là nguy cơ ung thư da. Bởi vậy, việc sử dụng kem chống nắng hàng ngày khi tiếp xúc với ánh nắng mặt trời là việc cần thiết mà cô nàng nào cũng cần chú ý. <strong>Gel Sữa Chống Nắng SPF50/PA++++ Perfect UV Gel – </strong>một sản phẩm chống nắng dạng gel của <strong>Senka</strong> sẽ là một trong những lựa chọn lý tưởng cho mùa hè này.\r\n\r\n&nbsp;\r\n\r\n<img class=\"loading\" src=\"https://media.hasaki.vn/wysiwyg/QuynhNga/Gel-sua-chong-nang-SPF50PA.JPG\" alt=\"\" width=\"493\" height=\"449\" data-was-processed=\"true\" />\r\n\r\n<strong>Gel Sữa Chống Nắng SPF50/PA++++ Perfect UV Gel </strong>có kết cấu dạng gel sữa mang lại cảm giác mát mẻ, khô ráo, dễ dàng thẩm thấu trên da, không nhờn rít, giúp dịu mát làn da. Với sức mạnh từ kén tơ tằm trắng Mayu Haku kết hợp công dụng từ thành phần “sericin” trong kén tơ tằm trắng và chất “hydrolyzed silk” được lấy từ lõi của sợi tơ tằm, <strong>Gel Sữa Chống Nắng SPF50/PA++++ Perfect UV Gel Senka </strong>giúp cho hiệu quả dưỡng ẩm trọn vẹn hơn gấp nhiều lần.\r\n\r\n<strong>Gel Sữa Chống Nắng SPF50/PA++++ Perfect UV Gel Senka </strong>có chỉ số SPF 50+ chống lại tia UVB, tác nhân gây sạm da, cháy nắng… Chỉ số PA++++ chống lại