INSERT INTO `wp_wc_admin_notes` VALUES (4,'wc-admin-orders-milestone','info','en_US','First order','Congratulations on getting your first order from a customer! Learn how to manage your orders.','trophy','{}','unactioned','woocommerce-admin','2020-05-21 01:11:14',NULL,0,'',NULL,0,0),(5,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','info','{}','unactioned','woocommerce-admin','2020-05-21 01:11:15',NULL,0,'',NULL,0,0),(6,'wc-update-db-reminder','update','en_US','Yêu cầu cập nhật cơ sở dữ liệu Quản lý bán hàng','Quản lý bán hàng đã được cập nhật! Để đảm bảo mọi thứ hoạt động trơn tru, chúng tôi cần cập nhật cơ sở dữ liệu lên bản mới nhất. Quá trình cập nhật cơ sở dữ liệu sẽ chạy nền và sẽ mất chút thời gian, hãy kiên nhẫn. Người dùng cao cấp có thể cập nhật thay thế qua <a href=\"https://github.com/woocommerce/woocommerce/wiki/Upgrading-the-database-using-WP-CLI\">WP CLI</a>.','info','{}','unactioned','woocommerce-core','2020-05-11 17:15:00',NULL,0,'plain',NULL,0,0),(7,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.','phone','{}','unactioned','woocommerce-admin','2020-05-23 05:29:01',NULL,0,'',NULL,0,0),(8,'wc-admin-onboarding-email-marketing','info','en_US','Tips, product updates, and inspiration','Chúng tôi ở đây cùng bạn — nhận các mẹo, thông tin, và cảm hứng trực tiếp đến email của bạn.','mail','{}','unactioned','woocommerce-admin','2020-05-23 05:29:01',NULL,0,'',NULL,0,0),(10,'wc-admin-facebook-extension','info','en_US','Market on Facebook','Grow your business by targeting the right people and driving sales with Facebook. You can install this free extension now.','thumbs-up','{}','unactioned','woocommerce-admin','2020-05-25 04:28:42',NULL,0,'',NULL,0,0),(11,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://mypham01.muathemewordpress.net/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.','info','{}','unactioned','woocommerce-admin','2020-05-28 05:19:09',NULL,0,'',NULL,0,0),(12,'paypal_ppcp_gtm_2021','marketing','en_US','Offer more options with the new PayPal','Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(13,'facebook_pixel_api_2021','marketing','en_US','Improve the performance of your Facebook ads','Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved measurement and ad targeting capabilities.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(14,'facebook_ec_2021','marketing','en_US','Sync your product catalog with Facebook to help boost sales','A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(15,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(16,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(17,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requests—customers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(18,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0,0),(19,'your-first-product','info','en_US','Your first product','That’s huge! You’re well on your way to building a successful online store — now it’s time to think about how you’ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','info','{}','pending','woocommerce.com','2021-05-19 16:13:00',NULL,0,'plain','',0